{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/joechapa/eda-of-cyclistic-bike-share-program?scriptVersionId=126593327\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"fdfcd4a0","metadata":{"papermill":{"duration":0.01569,"end_time":"2023-04-20T23:12:51.09099","exception":false,"start_time":"2023-04-20T23:12:51.0753","status":"completed"},"tags":[]},"source":["# Introduction\n","\n","The goal of this case study is to offer a thorough analysis of Cyclistic, a fictional bike-share provider in Chicago. To achieve this goal, we will use the six stages of the data analysis process — “ask, prepare, process, analyze, share, and act”.\n","\n","# Ask\n","\n","The Cyclistic marketing analytics team aims to identify differences in usage patterns between annual members and casual riders. These insights will allow us to recommend marketing strategies to convert causal users to annual members. These recommendations will then be presented to marketing director and executive team for review. This project is crucial to Cyclistic’s growth and competitiveness in the bike-share market.\n","\n","# Prepare\n","\n","We obtained the past 12 months (April 2022 - March 2023) of Cyclistic trip data from our AWS S3 bucket“divvy-tripdata”. As our data is in-house, it a reliable. Our data consists of 12 CSV files and was downloaded to the directory “~/Google Capstone Project/csv”. It was imported into excel and checked for completeness and accuracy. As a reminder, our data is subject to this licensed agreement with Lyft Bikes and Scooters, LLC, ensuring that licensing, privacy, security, and accessibility concerns were addressed.\n","\n","One issue this data posed was its size. Based on our analysis, we recommend using a machine with at least 16 GB of RAM to efficiently replicate our results. A detailed data dictionary is 