d move onward."]},{"cell_type":"code","execution_count":25,"id":"e6efc513","metadata":{"execution":{"iopub.execute_input":"2023-04-20T23:27:45.618357Z","iopub.status.busy":"2023-04-20T23:27:45.616679Z","iopub.status.idle":"2023-04-20T23:27:46.774557Z","shell.execute_reply":"2023-04-20T23:27:46.772824Z"},"papermill":{"duration":1.182262,"end_time":"2023-04-20T23:27:46.77703","exception":false,"start_time":"2023-04-20T23:27:45.594768","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["       rideable_type    \n"," classic_bike :2839838  \n"," electric_bike:2131673  "]},"metadata":{},"output_type":"display_data"}],"source":["all_trips_v5 <- all_trips_v5 %>%\n","  mutate(rideable_type = fct_recode(rideable_type, \"classic_bike\" = \"docked_bike\"))\n","summary(all_trips_v5[\"rideable_type\"])"]},{"cell_type":"markdown","id":"b7262233","metadata":{"papermill":{"duration":0.018666,"end_time":"2023-04-20T23:27:46.813801","exception":false,"start_time":"2023-04-20T23:27:46.795135","status":"completed"},"tags":[]},"source":["### 2) end_lat and end_lng\n","\n","Upon inspection of the data, we discovered that the `0` values for `end_lat` and `end_lng` were specifically associated with `end_station_id` equaling \"chargingstx07.\" Although we are uncertain how this occurred, we noticed that `chargingstx07` does possess some values for `end_lat` and `end_lng.` To remedy the issue, we can compute the average of the existing `end_lat` and `end_lng` values and use them to fill in the `0` values. However, we must also account for the fact that `end_lat` and `end_lng` are used to compute `ride_length_minutes.` Thus, we need to adjust the `ride_length_minutes` for the modified values."]},{"cell_type":"code","execution_count":26,"id":"142045b9","metadata":{"execution":{"iopub.execute_input":"2023-04-20T23:27:46.852529Z","iopub.status.busy":"2023-04-20T23:27:46.85108Z","iopub.status.idle":"2023-04-20T23:27:56.036489Z","shell.execute_reply":"2023-04-20T23:27:56.034517Z"},"papermill":{"duration":9.207531,"end_time":"2023-04-20T23:27:56.038747","exception":false,"start_time":"2023-04-20T23:27:46.831216","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["    end_lat         end_lng      \n"," Min.   :41.65   Min.   :-87.83  \n"," 1st Qu.:41.88   1st Qu.:-87.66  \n"," Median :41.90   Median :-87.64  \n"," Mean   :41.90   Mean   :-87.65  \n"," 3rd Qu.:41.93   3rd Qu.:-87.63  \n"," Max.   :42.06   Max.   :-87.53  "]},"metadata":{},"output_type":"display_data"}],"source":["chargingstx07 <-  all_trips_v5 %>%\n","  filter(end_station_id == \"chargingstx07\" & end_lat != 0 & end_lng != 0 )\n","\n","chargingstx07_lat_mean = mean(chargingstx07$end_lat)\n","chargingstx07_lng_mean = mean(chargingstx07$end_lng)\n","\n","#fill the 0 values\n","all_trips_v6 <- all_trips_v5 %>%\n","    mutate(end_lat = if_else(end_lat == 0, chargingstx07_lat_mean, end_lat),\n","           end_lng = if_else(end_lng == 0, chargingstx07_lng_mean, end_lng))\n","\n","#check if end_lat/end_lng changed from all_trips_v5 to minimize re-calculations\n","all_trips_v6 <- all_trips_v6 %>%\n","  mutate(ride_distance_miles = \n","           if_else(end_lat != all_trips_v5$end_lat | end_lng != all_trips_v5$end_lng,\n","                   distHaversine(p1 = cbind(start_lng, start_lat),p2 = cbind(end_lng, end_lat)) * m_to_miles_converstion_rate,\n","                                  ride_distance_miles))\n","\n","summary(all_trips_v6[c(\"end_lat\", \"end_lng\")])"]},{"cell_type":"markdown","id":"9fded8db","metadata":{"papermill":{"duration":0.01676,"end_time":"2023-04-20T23:27:56.072895","exception":false,"start_time":"2023-04-20T23:27:56.056135","status":"completed"},"tags":[]},"source":["### 3) ride_length_minutes\n","\n","#### A) Negative Values\n","\n","After examining `ride_length_minutes`, we noticed that the phrase \"Hubbard Bike-checking (LBS-WH-TEST)\" appears in both the `start_station_id` and `end_station_id` columns for certain entries. Further research w